"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Preserving fertility after cancer treatment in women (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/preserving-fertility-after-cancer-treatment-in-women-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H199021068\">",
"      <span class=\"h1\">",
"       What is fertility?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Fertility is the term doctors use to describe a woman&rsquo;s ability to get pregnant. After some types of cancer treatment, women can have trouble getting pregnant. &ldquo;Preserving fertility after cancer treatment&rdquo; involves doing things before or during cancer treatment to raise a woman&rsquo;s chances of getting pregnant later on.",
"     </p>",
"     <p>",
"      <strong>",
"       Which cancer treatments can cause fertility problems?",
"      </strong>",
"      &ndash; Cancer treatments that can cause fertility problems include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Chemotherapy &ndash; Chemotherapy is the term doctors use to describe a group of medicines that kill cancer cells.",
"       </li>",
"       <li>",
"        Radiation therapy &ndash; Radiation involves getting high doses of X-rays.",
"       </li>",
"       <li>",
"        Surgery &ndash; If a woman&rsquo;s ovaries (female sex organs) are removed, she can&rsquo;t get pregnant (",
"        <a class=\"graphic graphic_figure graphicRef80271 \" href=\"UTD.htm?14/52/15171\">",
"         figure 1",
"        </a>",
"        ). If a woman&rsquo;s uterus is removed, she can&rsquo;t carry a pregnancy.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Chemotherapy and radiation can damage or destroy eggs in the ovaries. As a result, women might stop having periods or have irregular periods. Also, radiation can damage the uterus, which can make it hard to carry a pregnancy.",
"     </p>",
"     <p>",
"      Not everyone who gets chemotherapy or radiation will have fertility problems. With chemotherapy, it depends on the medicine and dose a person gets. With radiation, it depends on the dose and part of the body treated.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H199021106\">",
"      <span class=\"h1\">",
"       What should I do if I want to get pregnant someday?",
"      </span>",
"      &nbsp;&mdash;&nbsp;You should let your doctor know",
"      <strong>",
"       BEFORE",
"      </strong>",
"      you start your cancer treatment. In some cases, treatment that has a lower chance of affecting future fertility might be available.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H199021121\">",
"      <span class=\"h1\">",
"       Are there other ways to preserve fertility?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Different things that can be done to help women preserve their fertility include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Embryo banking &ndash; This involves collecting eggs before you start cancer treatment. The doctor fertilizes the eggs with sperm in a lab to make embryos. An embryo is a group of cells that grow after a woman&rsquo;s egg and a man&rsquo;s sperm join together. The embryos can then be frozen and stored until they are used later on.",
"       </li>",
"       <li>",
"        Shielding the ovaries or uterus during radiation treatment &ndash; This involves wearing a special shield on the outside of your body during radiation treatment. The shield covers and protects your organs, so they aren&rsquo;t damaged by the radiation.",
"       </li>",
"       <li>",
"        Moving your ovaries &ndash; If your ovaries are in the path of the radiation, your doctor can move them slightly to keep them from getting damaged.",
"       </li>",
"       <li>",
"        Taking medicines to keep your ovaries from working as well during your cancer treatment",
"       </li>",
"       <li>",
"        Freezing and storing eggs (that are not fertilized) or tissue from your ovaries",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H199021136\">",
"      <span class=\"h1\">",
"       How do I decide which option is right for me?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The best way to preserve your fertility depends on your cancer, treatment, age, and individual situation. Talk with your doctor about your different choices. To make your decision, you might want to think about:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        The benefits and downsides of the choices",
"       </li>",
"       <li>",
"        How long they take &ndash; For example, embryo banking takes a few weeks. This could delay the start of your cancer treatment.",
"       </li>",
"       <li>",
"        How well your doctor thinks they will work",
"       </li>",
"       <li>",
"        How much they cost &ndash; For example, it costs money to collect, freeze, and store embryos. Health insurance sometimes pays for these things.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H199021153\">",
"      <span class=\"h1\">",
"       What if I still can&rsquo;t get pregnant?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you still can&rsquo;t get pregnant after cancer treatment, you have other choices:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        You and your partner can try to have a baby using a donated egg.",
"       </li>",
"       <li>",
"        You can have another woman (called a &ldquo;surrogate&rdquo;) carry a pregnancy for you.",
"       </li>",
"       <li>",
"        You might choose to adopt.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Couples can have a tough time making these decisions. You might find it helpful to talk to a counselor or go to a support group for people who are facing the same issues.",
"     </p>",
